const totalItemFromArray = (data, item) => {
    return data.reduce((prevVal, currVal) => {
      return (
        (isNaN(parseInt(prevVal)) ? 0 : parseInt(prevVal)) +
        (isNaN(parseInt(currVal[item])) ? 0 : parseInt(currVal[item]))
      );
    }, 0);
  };

export default totalItemFromArray
